import React, { Component } from 'react';
import SearchBar from './SearchBar';
import axios from 'axios';
import logo from '../img/logo.svg';
import '../css/App.css';

class App extends Component {
  state = { items: [] }

  onSearchSubmit = axios.get("https://api.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=c77106e8aeacd801918789f8dcf36e53e&per_page=10&format=json&nojsoncallback=1") 
  .then((response) => {
    console.log(response.data.items);
    this.setState({
        items: response.data.items
    })
  })
  .catch((err) => {
  console.log(err)
  })

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <a
            className="App-link"
            href="http://github.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            Checkout the repo.
          </a>
        </header>

        <SearchBar onSubmit={this.onSearchSubmit} />
      </div>
    );
  }
}

export default App;
